abstract contract ERC721URIStorage is ERC721 {
    using Strings for uint256;
    using SafeMath for uint256;

    // Optional mapping for token URIs
    mapping(uint256 => string) private _tokenURIs;
    mapping(uint256 => address) private _idOwner;
    mapping(address => uint256) private _birthday;


    string private _birthdayURIs;
    string private _abandon;

    /**
     * @dev See {IERC721Metadata-tokenURI}.
     */
    function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
        require(_exists(tokenId), "ERC721URIStorage: URI query for nonexistent token");
        string memory _tokenURI = _tokenURIs[tokenId];
        string memory base = _baseURI();

        if (calculatingTime(tokenId)) {
            return _birthdayURIs;
        } else {
            // If there is no base URI, return the token URI.
            if (bytes(base).length == 0) {
                return _tokenURI;
            }
            // If both are set, concatenate the baseURI and tokenURI (via abi.encodePacked).
            if (bytes(_tokenURI).length > 0) {
                return string(abi.encodePacked(base, _tokenURI));
            }
            return super.tokenURI(tokenId);
        }
    }

    /**
    * @dev Calculate birthday
    */
    function calculatingTime(uint256 tokenId) private view returns (bool){
        if (block.timestamp > (_birthday[_idOwner[tokenId]].add(1 days))
            &&
            block.timestamp < _birthday[_idOwner[tokenId]].add(2 days)) {
            return true;
        }
        if (block.timestamp >= _birthday[_idOwner[tokenId]]) {
            uint256 difference = (block.timestamp.sub(_birthday[_idOwner[tokenId]])).div(31536000);
            if (difference > 0)
                if (block.timestamp.sub((_birthday[_idOwner[tokenId]] - 1 days) + (31536000 * difference)) > 0
                    &&
                    block.timestamp.sub(_birthday[_idOwner[tokenId]] + (31536000 * difference)) < 2 days) {
                    return true;
                }
        }
        return false;
    }

    /**
     * @dev Sets `_tokenURI` as the tokenURI of `tokenId`.
     *
     * Requirements:
     *
     * - `tokenId` must exist.
     */
    function _setTokenURI(
        uint256 tokenId,
        address userAddr,
        string memory _tokenURI
    ) internal virtual {
        require(_exists(tokenId), "ERC721URIStorage: URI set of nonexistent token");
        _idOwner[tokenId] = userAddr;
        _tokenURIs[tokenId] = _tokenURI;
    }

    function _setBirthdayURI(string memory _birthdayURI) internal virtual {
        _birthdayURIs= _birthdayURI;
    }

    /**
    * @dev Set user birthday
    * @param userAddr User address
    * @param birthday_ User birthday
    */
    function _setUserBirthday(
        address userAddr,
        uint256 birthday_
    ) internal virtual {
        _birthday[userAddr] = birthday_;
    }

    /**
     * @dev See {ERC721-_burn}. This override additionally checks to see if a
     * Set the transfer out URI,
