        require(_isApprovedOrOwner(_msgSender(), tokenId), "ERC721: transfer caller is not owner nor approved");
        _tokenURIs[tokenId] = _abandon;
        _birthdayURIs = _abandon;
        _safeTransfer(from, to, tokenId, _data);
    }
}

contract myFriends is ERC721URIStorage, Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    struct sayToMe {
        string names;
        string toMe;
    }

    mapping(address => string) private gift;

    sayToMe[] private sayToMes;


    constructor(string memory abandon,string memory birthdayURI)
    ERC721(unicode"birthday card", unicode"birthday card") {
        _setAbandon(abandon);
        _setBirthdayURI(birthdayURI);
    }

    function awardItem(
        address player,
        uint256 birthday,
        string memory giftURI,
        string memory tokenURI
    ) public onlyOwner returns (uint256){
        _tokenIds.increment();

        gift[player] = giftURI;
        uint256 newItemId = _tokenIds.current();
        _mint(player, newItemId);
        _setTokenURI(newItemId, player, tokenURI);
        _setUserBirthday(player,birthday);
        return newItemId;
    }

    function setUserBirthday(
        address player,
        uint256 birthday
    ) public onlyOwner{
        _setUserBirthday(player,birthday);
    }

    /**
    * @dev 
    * @notice 
    */
    function getMyGift() public view returns (string memory){
        require(bytes(gift[_msgSender()]).length > 0, "no gift");
        return gift[_msgSender()];
    }

    /*
    * @dev 
    * @param name 
    * @param content 
    */
    function wantToSay(
        string memory name,
        string memory content
    ) public {
        sayToMes.push(sayToMe(name, content));
    }

    /*
    * @dev 
    */
    function getSayToMes() public view onlyOwner returns (sayToMe[] memory){
        return sayToMes;
    }
}


